import React from "react";
import Navbar from "./navbar";
import Footer from "./footer";
const Reviews = () => {
    return (
        <div className="Reviews">
            <header>
                <Navbar />
                <div className="jumbo">
                    <h1>EXPERIENCE Geneva</h1>
                </div>
            </header>
            <main>
                <h1>Reviews</h1>
            </main>
            <footer>
                <Footer />
            </footer>
        </div>
    );
};

export default Reviews;
